pragma solidity >=0.7.0 <0.9.0;

import "../lib/structures.sol";        // шаблон структур

// COMMENT: Контракт хранит в себе функции проверка.
contract validateFuncs is structures {
    function validateOwner() public view returns (bool) {
        if(structUsers_[msg.sender].role == Role.SYSTEM_OWNER) {
            return (true);
        } else {
            return (false);
        }
    }
